    return (
        <div>
            <ButtonClear
                isSun={isSun}
                todos={todos}
                deleteCompletedTodos={deleteCompletedTodoHandler}
            />
            <ButtonFilter isSun={isSun} filterTodo={filterTodoHandler} />
            <h2>Drag and drop to reorder list</h2>
        </div>
    );
}

export default ButtonContainer;
